import React from 'react';

class RsvpInfo extends React.Component {

    render() {
            return (
                <div id="info">
                    <label>Email </label>
                    <input />
                    <div>
                        <label>Address</label>
                        <input />
                        <input />
                        <input />
                    </div>
                    <div>
                        <label htmlFor="plus1">Plus 1 ?</label>
                        <select name="plus1">
                            <option value={true}>Yes</option>
                            <option value={false}>No</option>
                        </select>
                    </div>  
                </div>   
            )             
    }
}

export default RsvpInfo;
